mod prover;

mod web {
    use alloy_primitives::{hex::FromHex, Bytes};
    use lazy_static::lazy_static;

    use crate::prover::Prover;
    lazy_static!(
        static ref PROOF: Bytes = Bytes::from_hex("").unwrap();
    );

    #[tokio::test(flavor = "multi_thread")]
    async fn main() -> anyhow::Result<()> {
        let prover =
            Prover::new(host_utils::ProofMode::Groth16, guest_wrapper::CALL_GUEST_ELF.clone());
        prover.prove(&PROOF)?;
        Ok(())
    }
}
